DROP TABLE IF EXISTS site_currency;
DROP TABLE IF EXISTS currency;
DROP TABLE IF EXISTS employer;
DROP TABLE IF EXISTS translation_history;
DROP TABLE IF EXISTS translation;
DROP TABLE IF EXISTS site;
DROP TABLE IF EXISTS language;
DROP TABLE IF EXISTS area;



CREATE TABLE area
(
  area_id serial NOT NULL,
  parent_id integer NOT NULL DEFAULT 0,
  name character varying(128) NOT NULL DEFAULT ''::character varying,
  priority integer NOT NULL DEFAULT 0,
  alias integer,
  country character varying(2) DEFAULT NULL::character varying,
  vacancy_post_status integer DEFAULT 0, 
  price_rate numeric(10,8) NOT NULL DEFAULT 0,
  geoip_location_id integer NOT NULL DEFAULT 0,
  code character varying(3) DEFAULT ''::bpchar,
  price_rate_for_favpp numeric(7,5) NOT NULL DEFAULT 1.00000,
  type smallint NOT NULL DEFAULT 0,
  deprecated boolean DEFAULT false,
  path character varying(255) NOT NULL DEFAULT ''::character varying,
  bonus_program_id integer,
  central_premium boolean DEFAULT false,
  iso_code character varying(2),
  time_zone character varying(9),
  weight integer NOT NULL DEFAULT 0,
  aho_office_email character varying(255),
  lat double precision,
  lng double precision,
  CONSTRAINT area_pk PRIMARY KEY (area_id),
  CONSTRAINT area_path_unique UNIQUE (path)
);

CREATE TABLE language
(
  language_id serial NOT NULL,
  name character varying(128) DEFAULT NULL::character varying,
  iso_code character varying(3) DEFAULT NULL::character varying,
  CONSTRAINT language_pk PRIMARY KEY (language_id)
);

CREATE TABLE site
(
  site_id serial NOT NULL,
  base_url character varying(255) NOT NULL DEFAULT ''::character varying,
  area_id integer NOT NULL DEFAULT 0,
  service_category_id integer NOT NULL DEFAULT 1,
  seller_account_id integer NOT NULL DEFAULT 1,
  platform_id integer NOT NULL DEFAULT 0,
  code character varying(64) NOT NULL,
  price_region_id integer NOT NULL,
  sms_service_enabled integer NOT NULL DEFAULT 0,
  language_id integer,
  region_center integer,
  CONSTRAINT site_pk PRIMARY KEY (site_id),
  CONSTRAINT area_id_fkey FOREIGN KEY (area_id)
      REFERENCES area (area_id) MATCH SIMPLE
      ON UPDATE CASCADE ON DELETE RESTRICT,
  CONSTRAINT region_center_area_fk FOREIGN KEY (region_center)
      REFERENCES area (area_id) MATCH SIMPLE
      ON UPDATE NO ACTION ON DELETE NO ACTION,
  CONSTRAINT site_language_id_fkey FOREIGN KEY (language_id)
      REFERENCES language (language_id) MATCH SIMPLE
      ON UPDATE NO ACTION ON DELETE NO ACTION,
  CONSTRAINT site_base_url_uniq UNIQUE (base_url),
  CONSTRAINT site_code_uniq UNIQUE (code)
);

CREATE TABLE translation
(
  translation_id serial NOT NULL,
  name character varying(128) NOT NULL DEFAULT ''::character varying,
  value text NOT NULL,
  site_id integer NOT NULL DEFAULT 0,
  lang character varying(2) DEFAULT NULL::character varying,
  dirty boolean NOT NULL DEFAULT true,
  ui boolean NOT NULL DEFAULT false,
  CONSTRAINT site_id_fkey FOREIGN KEY (site_id)
      REFERENCES site (site_id) MATCH SIMPLE
      ON UPDATE CASCADE ON DELETE RESTRICT
);

CREATE TABLE translation_history
(
  translation_history_id integer NOT NULL,
  modification_time timestamp without time zone NOT NULL DEFAULT clock_timestamp(),
  user_id integer,
  site_id integer NOT NULL,
  lang character varying(2) DEFAULT NULL::character varying,
  name character varying(128) NOT NULL DEFAULT ''::character varying,
  old_value text,
  new_value text,
  CONSTRAINT site_id_fkey FOREIGN KEY (site_id)
      REFERENCES site (site_id) MATCH SIMPLE
      ON UPDATE CASCADE ON DELETE SET NULL
);

CREATE TABLE employer
(
  employer_id serial NOT NULL,
  manager_id integer,
  creation_time timestamp without time zone NOT NULL,
  area_id integer NOT NULL DEFAULT 0,
  name character varying(512) NOT NULL DEFAULT ''::character varying,
  agreement_id character varying(16) NOT NULL DEFAULT ''::character varying,
  category integer NOT NULL DEFAULT (-1),
  url character varying(255) DEFAULT NULL::character varying,
  group_name character varying(128) DEFAULT NULL::character varying,
  on_firstpage integer DEFAULT 0,
  in_best_list integer DEFAULT 0,
  delivery_address text,
  discard_status integer NOT NULL DEFAULT 0,
  hide_type integer NOT NULL DEFAULT 0,
  size integer NOT NULL DEFAULT 0,
  pay_readiness integer NOT NULL DEFAULT 0,
  corporate_gift integer DEFAULT 0,
  own_policy integer NOT NULL DEFAULT 0,
  employer_branch_head_company_action_type integer DEFAULT (-1),
  employer_branch_type integer DEFAULT (-1),
  owning_employer integer DEFAULT 0,
  email_for_vacancy_responces character varying(128) DEFAULT NULL::character varying,
  is_hidden integer DEFAULT 0,
  resume_views integer DEFAULT 0,
  bank_detail_id integer,
  delivery_person character varying(255) DEFAULT NULL::character varying,
  main_insider_id integer DEFAULT 0,
  vacancy_response_replay boolean NOT NULL DEFAULT false,
  normalized_name character varying(128) NOT NULL DEFAULT ''::character varying,
  open_vacancies_number integer DEFAULT 0,
  vfs_file_id integer,
  how_did_you_hear_about_us_id integer,
  duplicated_employer integer NOT NULL DEFAULT 0,
  hidden_name character varying(64) DEFAULT NULL::character varying,
  resume_views_limit integer NOT NULL DEFAULT 0,
  view_similar_vacancy integer NOT NULL DEFAULT 1,
  registration_platform_id integer NOT NULL DEFAULT 0,
  parent_id integer,
  subsidiary_rank integer,
  structure_name character varying(255),
  discard_status_employer_id integer,
  small_logo_url character varying(255),
  talentlink_client boolean,
  page_template character varying(256),
  organization_form integer,
  state integer,
  last_change_time timestamp without time zone,
  confirmed_anonymous boolean NOT NULL DEFAULT false,
  must_discard_by_robot integer NOT NULL DEFAULT 0,
  site_id integer,
  vacancy_page_template character varying(256),
  country_id integer,
  employees_number smallint,
  registration_completed boolean,
  employer_request_handler_id integer,
  dublicated_employer_b boolean NOT NULL DEFAULT false,
  corporate_gift_b boolean NOT NULL DEFAULT false,
  hide_type_b boolean NOT NULL DEFAULT false,
  view_similar_vacancy_b boolean NOT NULL DEFAULT true,
  must_discard_by_robot_b boolean NOT NULL DEFAULT false,
  hidden boolean NOT NULL DEFAULT false,
  CONSTRAINT employer_pk PRIMARY KEY (employer_id),
  CONSTRAINT employer_area_id_fkey FOREIGN KEY (area_id)
      REFERENCES area (area_id) MATCH SIMPLE
      ON UPDATE NO ACTION ON DELETE NO ACTION,
  CONSTRAINT site_id_fkey FOREIGN KEY (site_id)
      REFERENCES site (site_id) MATCH SIMPLE
      ON UPDATE CASCADE ON DELETE RESTRICT
);

CREATE TABLE currency
(
  code character(3) NOT NULL,
  rate numeric(10,6) NOT NULL DEFAULT 0,
  masculine boolean NOT NULL,
  scale integer NOT NULL DEFAULT 2,
  last_rate_change_time timestamp without time zone NOT NULL DEFAULT now(),
  CONSTRAINT currency_pkey PRIMARY KEY (code)
);

CREATE TABLE site_currency
(
  site_id integer NOT NULL DEFAULT 0,
  available_currency_id integer NOT NULL DEFAULT 0,
  available_currency character(3) NOT NULL
);



CREATE INDEX area_name_indx ON area USING btree(name);

CREATE INDEX language_iso_code_key ON language USING btree(iso_code);
CREATE INDEX language_name_indx ON language USING btree(name);

CREATE INDEX site_area_id ON site USING btree(area_id);

CREATE INDEX translation_name_lang_idx ON translation USING btree (name, lang);
CREATE INDEX translation_name_site_id_lang_idx ON translation USING btree (name, site_id, lang);
CREATE INDEX translation_value_idx ON translation USING btree (value);

CREATE INDEX translation_history_modification_time_desc_index ON translation_history USING btree (modification_time DESC);
CREATE INDEX translation_history_name_lang_idx ON translation_history USING btree (name, lang);

CREATE INDEX employer_creation_time ON employer USING btree (creation_time);
CREATE INDEX employer_state_category_key ON employer USING btree (state, category);

CREATE UNIQUE INDEX site_currency_currency_index ON site_currency USING btree(site_id, available_currency);












