INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5795997, 'catalog.text.spec.19', 'Сізге жұмыс іздеуде қол ұшын бергісі келмейтін делдалдық жүйемен күресіп шаршадыңыз ба? «Жылжымайтын мүлік саласының өкілі» сұранысыңызға басқа қалалардың жіберген  азғантай сұранысы шыға ма? Ендеше біздің ұсыныстар каталогымызды пайдаланыңыз! Бірнеше батырманы басу арқылы, сіз мыңдаған ваканциялардың ішінен жылжымайтын мүлік саласының өкіліне арналған қызықты да сапалы қызметтерді табасыз. Қолайлы интерфейс өзіңіз ұнатқан ұсынысқа тез арада үн қатуыңызға, жұмыс ұсынушының шешімінен  хабардар болып отыруыңызға мүмкіндік жасайды.Ең қызықты ваканциялар – тек біздің сайтымызда!', 1, 'KZ', false, false);
