INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796406, 'catalog.text.spec.8', 'Маркетингтік қызмет көрсету саласы және ПР талап етілетін және келешекті жұмыс.  "Ең үздік жұмыс орын ұсыныстарын қайдан және қалай табу керек?" деген сұрақ әрқашан көкейде тұрады. Сіздің бұл сұрағыңызға біздің өзекті зерттеулеріміз, жаңалықтар және тұтынушылардың пікірін тұрақты сұрап отыруымыздың көмегі тиеді. Сіз жұмыс берушімен қалай тіл табыса білу керектігін, кім жақсы жұмыс шарттарын ұсынатынын, кімнен алшақ болу керектігін білетін боласыз. Сізге ыңғайлы болу үшін біз әрі маркетингтік қызмет көрсету  және ПР саласының тізімдемесінде сапалы,  тексеруден өткен ұсыныстар беріп отырмыз, сондықтан сізге әрбір жұмыс берушіге және ғаламтор толқынында отырып ұзақ уақытыңызды кетірудің қажеті жоқ!', 1, 'KZ', false, false);
