INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796193, 'catalog.text.spec.384', 'Өнеркәсіп жабдықтары сервисі жөніндегі менеджер жұмысы қызықтырады ма? Бірақ неден бастарын білмей, басыңыз қатып жүр ме? Егер көздеген мақсатыңыз тез және оңай үмітті вакансия табу болса, біздің сайтымызбен бұл мақсатыңызға сүрінбей жетесіз! Жалпы Мәскеу мен облыстардың мыңдаған компаниялары ұсынып отырған жұмыстар кез келген деңгей мен жастағы мамандардың талап-тілектерін қанағаттандыра алады. Біздің сайтымыз арқылы, күш-жігеріңіз бен жүйкеңізді тоздырмай, ең тартымды да ақшалы өнеркәсіп жабдықтары сервисі жөніндегі менеджер вакансияларын таба аласыз! Жақсы жұмыс – жақсы өмір!', 1, 'KZ', false, false);
