INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5795993, 'catalog.text.spec.18', 'Автосақтандыру саласынан жұмыс қарастыруда қиындықтар туындады ма? Делдалдық жүйе жүйекеңізді жұқартып, жақсы жұмыс табамын деген арманыңызды күл-талқан етіп, мүлде басқа  салалардың жұмысын ұсынуда ма? Біз бұл мәселені шешіп қойдық! Біздің жұмыс тобымыз автосақтандыру саласынан болашағы зор жұмыс іздеу сіздің санаулы секунттарыңызды ғана алу үшін барын салды! Клавиатураны ұмытыңыз, енді ол тек түйіндеме жазуға, жұмыс берушіңізбен хат алысуға ғана керек болады. Жақсы жұмыс – жолы болғыштарға арналады!', 1, 'KZ', false, false);
INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796336, 'catalog.text.spec.545', 'Көпшілігіміз үшін қызмет – өміріміздің  бір бөлшегі. Және ең маңыздысы жұмысымызды махаббатпен атқару – оның бізге қуаныш әкелуі! Егер сіз өміріңізге өзгеріс енгіңіз келіп, немесе алға жылжу жағын ойлап, жинақтаушы немесе салушы-ораушы жұмысын іздесеңіз, біздің қызмет көрсету желіміз сізге тез арада көмек береді!. Жайлы ұжым, жоғары жалақы, қызықты жобалар – осының барлығын біздің қызметтер топтамамыздан таба аласыз. Іздеу барысында біздің нәтижелі әдістерімізді пайдалана отырып, сіздің міндетті түрде табысты жинақтаушы, салушы-ораушылық жұмыспен қамтылатыныңызға кепілдік береміз!', 1, 'KZ', false, false);
