INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796239, 'catalog.text.spec.446', 'Әр адам мұқтажсыз, жарқын өмір, жеке үй мен жақсы мәшине туралы армандайды... Бірақ жақсы жұмыс болмай тұрып, бұл армандардың іске асуы екіталай екенін  барлығы да түсінеді. Егер сіз қауіпсіздік жүйелерін сату саласы төңірегінде жұмыс тауып, осының барлығына қол жеткізуді көздесеңіз, біздің порталымыз бұл істе сізге көмектеседі! Біз сізге еліміздің жетекші компанияларындағы табысқа жетелейтін сапалы да маңызды вакансияларды ұсынуға дайынбыз. Ал біздің тізімдемеміз қауіпсіздік жүйелерін сату саласындағы ең үмітті вакансияларға шығуға көмектеседі.', 1, 'KZ', false, false);
