INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796206, 'catalog.text.spec.4', 'Қызық та тартымды жұмыс іздестіру ісі қай жағынан бастау керектігін білмеген жанға, көбінесе, машақаты мол, қиын да ұзақ іске айналады. Бірақ біздің порталымызды пайдалана отырып, forex нарығының вакансияларын тез және нәтижелі іздестіру ісінің сырын біліп қана қоймай, оны бірден іске асыруға мүмкіндік туады! Бізден, күш-жігері мен уақытыңызды көп кетірмей, forex нарығындағы ең болашақты жұмысты таба аласыз. Мансап баспалдағының шегі туралы ұмытыңыз, бізбен бірге сіз әрдайым ілгері жылжи аласыз!', 1, 'KZ', false, false);
