INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796002, 'catalog.text.spec.194', 'Газет беттеріндегі ваканциялар, жақсы жұмыс табам деген арманыңыздың күлін көкке ұшырды ма? Делдалдық жүйе қажетсіз ақпараттарды ұсынуда ма?  Бұндай жағдай  салыңды суға кетірері сөзсіз! Сүйінші! Біздің жұмыс тобымыз қоғамдық ұйымдардан өзіңізді қызықтыратын жұмысты оңай табуыңыз үшін барын салды. Жүйкеңізді жұқартпаңыз! Енді сіз қиын сауалдарға жауап іздеп бас қатырмайсыз, бірнеше тетікті бассаңыз экраныңыздан  қоғамдық ұйымдарға сұраныс шыға келеді.', 1, 'KZ', false, false);
