INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796328, 'catalog.text.spec.536', 'Қызықты да үлкен сұранысқа ие қызметті табудың қаншалықты уақыттымызды алатынын барлық адам білетін шығар. Әсіресе өзімізге қатысы жоқ көптеген делдалдық жарнамалар арасынан оны таңдап алу оңай емес. Сізді бұл қиындықтан құтқарып алу үшін біз CRM-жүйесіндегі қызметкер сұранысының барлығын топтастырып қойдық. Бұл жерден сіз білікті маманға зәру мыңдаған компанияларды таба аласыз. Ал, егер түйіндемеңізді біздің сайтымызға орналастырсаңыз, CRM-жүйесі саласындағы жұмыстар оңай табылады! Өз уақытыңыз бен күшіңізді бағалаңыз!', 1, 'KZ', false, false);
INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5781736, 'vacancy.statistics.vacancyManager', 'Менеджер вакансій', 1, 'UA', false, false);
INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796011, 'catalog.text.spec.202', 'Сіз ғимаратқа кірген кезде бірінші кімді кездестіресіз? Әрине, күзетшіні! Күзетші – компанияның беткеұстар адамы! Өз ісінің шебері кеңсені берік қамалға айналдырып, оны сенімді екінші үйіңіз етеді! Енді сіз,ұйымшыл ұжым, жоғары жалақылы, еңбекке қолайлы күзетші ваканциясын біздің сайтымыздағы «күзетшілерге жұмыс» бөлімінен кездестіресіз. Біздің қызмет көрсету жүйемізді пайдалана отырып – алтын уақытыңызды бағалаңыз!', 1, 'KZ', false, false);
INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5781737, 'vacancy.statistics.vacancyType', 'Тип вакансії', 1, 'UA', false, false);
INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5781738, 'vacancy.statistics.viewed', 'Переглядів', 1, 'UA', false, false);
INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796397, 'catalog.text.spec.71', 'Журналистика саласында жұмыс істеу қызықтыра ма? Біз сізге күш-жігеріңіз бен жүйке-жүйеңізді тоздырмай, ең сапалы ұсыныстарды табуға көмектесеміз! Сіздің неғұрлым аз уақыт жұмсауыңызға, жұмыс орындарының сапалы болуына және ыңғайлы, қолжетімді болуы үшін барымызды салдық. Біздің тізімдемені пайдаланып, сіз ондаған басқа мамандықтардың ішін ақтарып отырмай, тек журналистика саласын ғана қарап нәтижеге жете аласыз! Өзіңізді және өз алтын уақытыңызды бағалаңыз - ең келешекті жұмыс бізде ғана!', 1, 'KZ', false, false);
