INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796088, 'catalog.text.spec.279', 'Кәсіп – дүниежүзіндегі көп таралған ауқымды мамандық. Осындай кәсіптер тасқынының арасынан өзекті әрі маңызды вакансиян табу өте күрделі. Осындай мамандықтандың қатарына станоктар мен ауыр жабдықтарды сату саласына қатысты жұмыстарды енгізуге болады. Бірақ біздің қызметіміз тіпті осы саладағы жұмыстарды да оңай табуға көмектесе алады! Сондықтан, егер сіз станоктар мен ауыр жабдықтарды сату саласындағы жұмысты іздеп жүрген болсаңыз және оны іздеуге уақытыңыз болмай жүрсе, біздің сайтты пайдаланыңыз. Сонда ең қызықты әрі тиімді ұсыныстар азғантай секундтың ішінде көз алдыңызда болады. Өзіңізі және өз уақытыңызды бағалаңыз, ең ұтымды жұмыстар – тек қана бізде!', 1, 'KZ', false, false);
