INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796102, 'catalog.text.spec.293', 'Сағат бойына қажетті жұмысты табу үшін сөзіңізді жүйелеп отырасыз, ал сізге теледидарда түсініксіз вакансиялар беріле ме? Іздеген жұмысыңызды таба алмай уақытыңызды босқа өткізу сізді шаршатты ма? Көңіліңіз түспесін. Біздің сайт сізге қол ұшын береді! Сіздің алтын уақытыңыз теледидар бетінен қажетті вакансияны сарылып күтуге кетпейді, өзіңізге керекті вакансияны біздің каталогтан табасыз. Тыныш және тиімді жұмыс тек бізде ғана!', 1, 'KZ', false, false);
