INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796409, 'catalog.text.spec.85', 'Астық өнімі мен өндіріс саласының инженері жұмыс орнын тез арада табу керек пе? Біздің сайтты пайдалансаңыз, ешқандай қиындық жоқ! Сіздің күіңіз бен уақытыңызды үнемдеп,  шарттары тиімді жұмыс табуға көмектесеміз. Біздің қызмет көрсетуіміз қолдануға ыңғайлы әрісоншалық жеңіл, тіпті сіз Ғаламторды алғаш қолданып отырсаңыз да, ол сізге ешқандай қиындық тудырмайды! Бар болғаны бірнеше үн қату, сіз біздің ұсыныс тізімдемемізден астық өндіру және өндіріс саласының инженері мамандығы бойынша Ресейдің алдыңғы қатарлы компаниялардың бірінен маңызды жұмыс орынын таба аласыз. Не болмаса түйіндеме жасап, біздің сайтымызда жариялаңыз.', 1, 'KZ', false, false);
INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5781560, 'vacancy.response.popup.testServiceDown.error', 'Вибачте, зараз сайт перевантажено, будь ласка, спробуйте пізніше', 1, 'UA', false, false);
INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796156, 'catalog.text.spec.348', 'Химия өнеркәсібі - кез келген қызмет үміткерлеріне жоғары талап қоятын, танымал сала. Осыған байланысты химия өнеркәсібі саласынан жұмыс іздеу ұзақ уақытқа созылуы мүмкін және барлық күш-жігеріңізді жұмсауды қажет етеді. Бірақ вакансияны іздеу мәселелерін оңай шешуге болады, егер біздің сайтты пайдалансаңыз! Қолайлы каталог жүйесі бір-екі үн қатудың арқасында кез келген аймақтағы химия өнеркәсібі саласындағы келешегі жоғары маңызды вакансияларды ұсына алады. Бізбен бірге жұмыс іздеу тек қуаныш әкеледі!', 1, 'KZ', false, false);
