INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5795990, 'catalog.text.spec.169', 'Қызықты да болашағы зор жұмыс іздеуде қиындықтар туындады ма? Жерге қатысты ғылым саласының қызметін басқаларынан ажыратып алуға көп уақыт шығындадыңыз ба? Біз сізге уақыт үнемдеуге көмектесеміз! Тек сіз үшін Жерге қатысты ғылым саласына жұмысшы іздеген барша сұраныстар осы бөлімде топтастырылған. Жүздеген білікті компаниялардың мыңдаған қызықты жобалары сізді күтуде, өзіңізге ұнағанын шертіп жүріп таңдаңыз!', 1, 'KZ', false, false);
