INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796175, 'catalog.text.spec.367', 'Егер сіз банк саласында жоғары жетістікке жеткіңіз келсе, онда банк технологиялары саласындағы жұмыстар сізге тиімді қызмет болмақ! Ал біздің сайтта сіз әрқашан келешегі зор, табысы жоғары вакансияларға ие бола аласыз. Әрине, ондай жұмысты іздеу үшін көп уақыт кетеді деуіңіз мүмкін. Бірақ біздің сервисті пайдалана отырып, ондай қиындыққа кездеспейсіз. Біздің каталог санаулы секунд ішінде банк технологиясы саласындағы барлық вакансияларды ұсына алады. Біздің зерттеуіміз еңбек нарығы курсындағы жаңа вакансияларды тиімді тарату, ал мамандар әрдайым дұрыс түйіндеме толтыруға көмек көрсетеді.', 1, 'KZ', false, false);
