INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796338, 'catalog.text.spec.547', 'Болашағы зор ұста қызметін іздеп жүрсіз бе? Іздегенге сұраған! Біздің қызмет жүйемізді пайдалана отырып, бірнеше тетікті басу арқылы, өзіңізге керекті жұмысқа үн қата аласыз. Түйіндемеңізді біздің сайтымызға лақтырыңыз, өзіңізге кәсіби маман ретінде сілтеме жасаңыз! Бұл әрекетіңіздің  сапалы жұмыс  табуға өз септігін тигізері сөзсіз, тіпті ұсталық қызмет сізді өзі іздеп келсе, таңғалмаңыз!', 1, 'KZ', false, false);
INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5781466, 'vacancyMetallic.advantage.standardOther.HH', 'Розміщення на сайті hh.ua допоможе Вам охопити більшу аудиторію', 1, 'UA', false, false);
INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796177, 'catalog.text.spec.369', 'Есептеу саласында қызмет еткіңіз келе ме, бірақ ондай қызметті тиімді әрі тез табудың жолын білмейсіз бе? Біздің портал  сізбен вакансияны тәзі әрі сәтті табудың құпияларын бөлісуге әрдайым дайын! Біздің сайттан жұмыс берушінің назарын аударатын, көпшіліктің ішінен сізді жұмысқа қабылдауына ықпал ететін сауатты түйіндемені дұрыс толтырудың жүйесін біле аласыз. Сілтемелерге тіркелу арқылы сіз еңбек нарығындағы ең соңғы жаңалықтардан хабардар боласыз, қайда барып жұмыс істеген тиімді екенін алдын ала біліп отырасыз. Ал біздің каталогты қолдана отырып, қаламыздағы есептеу саласының перспектикалық вакансияларымен қас қағым сәтте-ақ көріп таныса аласыз.', 1, 'KZ', false, false);
