INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796349, 'catalog.text.spec.559', 'Жұмыс іздеудің ескі жүйесін әлі қолданып келесіз бе? Жұмысқа сұраныстарды жариялайтын газет-журналдар керек әрине, бірақ олар соншалық сенімді емес. Біз өзіміздің жүйелі тізіміміз арқылы ылғи да жаңарып отыратын қызмет ұсыныстарын қолданудың жолдарын жеңілдетіп қойдық! Енді сізге бірнеше тетікті басу жеткілікті, сылақшылық қызметке сұраныс та басқа мамандықтар секілді экраныңызға шыға келеді! Сылақшы жұмысын табу мейлінше оңай болу үшін біз қолымыздан келгенін жасап қойдық!', 1, 'KZ', false, false);
