INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796154, 'catalog.text.spec.345', 'Қаржы мамандары басқа мамандар сияқты жұмыс іздеу қиындықтарына жиі ұшырайды. Жиі кездесетін кедергі ұсынылған вакансиялардың сапасыз болуынан және жұмыс берушімен байланыс орнатуға кететін ұзақ уақыттан туындайды. Біздің тұтынушыларға қамқорлық көрсету үшін біз барынша қолайлы интерфейсті құрастырдық. Онда қаржы саласындағы ең маңызды вакансияларды іріктеп жинақтадық. Енді үн қату жүйесі арқылы сіз жұмыс берушімен тез байланысқа шыға аласыз. Бізде қаржы саласына қатысты жұмысты кез келген адам оңай таба алады!', 1, 'KZ', false, false);
