INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796170, 'catalog.text.spec.360', 'Электроэнергетика саласы өте кең. Бұл саладан сіз өзіңізге лайықты келешегі жоғары жұмысты таба аласыз. Мұхиттай толастаған вакансиялық ұсыныстардың ішінен өзіңіз қалайтын жұмысты оңай табу үшін біз осы салаға қатысты бос жұмыс орындарын іріктеп каталогқа енгіздік. Қолайлы интерфейс сіз үн қатқан вакансияның ішінен тиімдісін таңдап беру үшін көмектеседі.', 1, 'KZ', false, false);
