INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796072, 'catalog.text.spec.263', 'Әрбір адам кедейліксіз, жарқын өмір сүруді армандайды, жеке үйі, жақсы машинасы болғанын қалайды. Бірақ жақсы жұмыс болмайынша бұл арманды жүзеге асыру мүмкін емес екенін барлығы біледі. Егер сіз кәсіпорын басшылығы саласындағы қызметті таба отырып, осы мақсаттарға жетуді көздеген болсеңіз, біздің портал көмекке келеді! Біз әрқашан сізге елдегі жетекші компанияларда болатын сапалы әрі маңызды  бос орынды ұсынуға дайынбыз. Біз ұсынған жұмыс арқылы сіз өз мақсатыңызға жете аласыз.    Біздің каталог бір-екі үн қатқаннан кейін-ақ кәсіпорын басшылығы саласындаы жұыстарға қол жеткізуге мүмкіндік береді.', 1, 'KZ', false, false);
