INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796398, 'catalog.text.spec.72', 'Заң шығарушы саласында жұмыс істеу ниетіңіз бар ма, бірақ оны қалай тез арада табу керек екенін білмейсіз бе? Біздің портал әрқашан тез және нәтижелі жұмыс табудың құпияларымен сізбен бөлісуге әзір. Біздің порталдан түйіндемені қалай дұрыс құрап, жұмыс беруші қалай сізді ғана таңдайтындай етудің жолдарын көрсетеді. Түйіндеме таратуға жазылып, еңбек нарығындағы жаңалықтар туралы хабар алып, оларды біліп, қайда жұмыс істеу тиімді екенін біліп отырасыз. Ал біздің ұсыныс тізімдемемізді қолданып, сіздің қалаңыздағы заң шығарушылық саласындағы келешекті жұмыстарды жылдам көре аласыз!', 1, 'KZ', false, false);
