INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796074, 'catalog.text.spec.265', 'Сізге жұмыс табуға ешқандай көмегі жоқ іздеу жүйесімен күресуден жалықтыңыз ба? «Ауылшаруашылығы саласындағы жұмысқа» сұраныс жасасаңыз басқа вакансиялар немесе басқа қалалардағы қызметтер ұсыныла ма? Онда біздің каталогтағы ұсыныстарды пайдаланыңыз! Тінтуірге бір-екі шерту арқылы сіз әп-сәтте ауылшаруашылығы саласындағы мыңдаған ұсыныстардың ішінен қызықты әрі жарқын жұмыс вакансиясына ие боласыз. Қолайлы интерфейс ұнаған ұсыныстарды лезде тауып беруге мүмкіндік жасайды және жұмыс берушінің шешіміне дейін бақылап отырады. Ең жарқын жұмыс - тек бізде ғана!', 1, 'KZ', false, false);
