INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796354, 'catalog.text.spec.561', 'Жоғары сұранысқа ие зергерші болып жұмыс істегіңіз келеді, бірақ бұл ойыңызды жүзеге асудың сәті түспей жүр ме? Бұл істе сізге біздің сайтымыз көмектеседі! Біздің мамандарымыз сізге қызметтің өзі іздеп келетіндей етіп түйіндеме жазуға көмектеседі. Біздің сұраныстарымыз бен зерттеулеріміздің арасынан ұсынылған жұмысқа қатысты, жұмыс берушіге қатысты өзіңізді мазалаған сұрақтарға жауап таба аласыз. Жүйеленген тізімдемеміздің арқасында мыңдаған мамандықтар арасынан өзіңізге қажетті зергерлік мамандығын тез табасыз. Бізбен бірге болашаққа жол тартыңыз!', 1, 'KZ', false, false);
