INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796157, 'catalog.text.spec.349', 'Қабілетті әрі мақсаты айқын химик әрқашан жұмыс таба алады! Бірақ үнемі жұмыс іздеу барысында қалаған қызметін тез әрі тиімді таба алмайды, кейде тіпті жауапсыз жұмыс берушілердің кесірінен сәтсіздіктерге ұшырауы да мүмкін. Бұндай жағдайда сізге көмектесу үшін, яғни уақыт үнемдеу үшін, кедергілерден аулақ болу үшін біз химия саласындағы бос жұмыс орындарын осы бөлімге іріктеп жинақтадық.   Солардың ішінен ең маңызды, келешегі жоғары вакансияны таңдаңыз! Бізден сіз әрдайым химия саласына қатысты қызықты әрі табысы жоғары вакансияларды таба аласыз!', 1, 'KZ', false, false);
